    private class GetData extends AsyncTask<Void, Void, Void>{

        ProgressDialog progressDialog;
        ArrayList cryptoCurrencyList;

        @Override
        protected void onPreExecute() {
            super.onPreExecute();

            progressDialog = new ProgressDialog(CalculatorActivity.this);
            progressDialog.setMessage(getString(R.string.waitMessage));
            progressDialog.setCancelable(false);
            progressDialog.show();
        }

        @Override
        protected Void doInBackground(Void... params) {

            Polaczenie polaczenie = new Polaczenie();

            String jsonString = polaczenie.nawiazPolaczenie(URL, Polaczenie.GET);

            Log.d("Response: ", "> " + jsonString);

            if(jsonString.contains("<!DOCTYPE html>") || jsonString.isEmpty()){
                jsonString = reusableJsonDataString;
                Log.d("Response: ", "> " + jsonString);
            }

            cryptoCurrencyList = parseJson_currencies(jsonString);

            return null;
        }

        @Override
        protected void onPostExecute(Void aVoid) {
            super.onPostExecute(aVoid);
            if(progressDialog.isShowing()){
                progressDialog.dismiss();
            }

            ListView listView = (ListView) findViewById(R.id.currency_list);
            cryptoCurrencyAdapter = new ArrayAdapter<>(
                    CalculatorActivity.this, android.R.layout.simple_list_item_1,
                    cryptoCurrencyList);
            listView.setAdapter(cryptoCurrencyAdapter);

            final ListView listView1 = (ListView) findViewById(R.id.currency_list2);
            realCurrencyArrayAdapter = new ArrayAdapter<>(
                    CalculatorActivity.this, android.R.layout.simple_list_item_1,
                    cryptoCurrencyList);
            listView1.setAdapter(realCurrencyArrayAdapter);

            SearchView searchView = (SearchView) findViewById(R.id.currency_search);
            searchView.setOnQueryTextListener(new SearchView.OnQueryTextListener() {
                @Override
                public boolean onQueryTextSubmit(String query) {

                    return false;
                }

                @Override
                public boolean onQueryTextChange(String newText) {
                    cryptoCurrencyAdapter.getFilter().filter(newText);
                    crypto_currency = newText;
                    return false;
                }
            });

            final SearchView searchView1 = (SearchView) findViewById(R.id.currency_search2);
            searchView1.setOnQueryTextListener(new SearchView.OnQueryTextListener() {
                @Override
                public boolean onQueryTextSubmit(String query) {

                    return false;
                }

                @Override
                public boolean onQueryTextChange(String newText) {
                    realCurrencyArrayAdapter.getFilter().filter(newText);
                    fiat_currency = newText;
                    return false;
                }
            });
        }
    }

    private ArrayList<String> parseJson_currencies(String json) {
        if(json != null) {
            try {
                ArrayList<String> currencies = new ArrayList<>();

                JSONObject jsonObject = new JSONObject(json);
                JSONArray jsonArray = jsonObject.getJSONArray(ROWS_TAG);

                for(int i = 0; i < jsonArray.length(); i++){

                    JSONObject object = jsonArray.getJSONObject(i);
                    String currency_code = object.getString(CURRENCY_CODE);
                    currencies.add(currency_code);
                }
                return currencies;
            } catch (JSONException e) {
                e.printStackTrace();
                return null;
            }
        } else {
            Log.d("ServiceHandler", "Can't get data from given url");
            return null;
        }
    }

    public void sendRequest(View view){
        try{
            if(crypto_currency.isEmpty() || fiat_currency.isEmpty()){
                Toast.makeText(this,R.string.calculator_warning,Toast.LENGTH_SHORT).show();
                return;
            }

            final_url = exchange_url;
            final_url = final_url.replace(CRYPTO_CURRENCY_PH, crypto_currency);
            final_url = final_url.replace(REAL_CURRENCY_PH, fiat_currency);

            Log.d("URL: ", final_url);
            new GetExchangeData().execute();

        } catch (NullPointerException e){
            Toast.makeText(this,R.string.calculator_warning,Toast.LENGTH_SHORT).show();
        } catch (NetworkOnMainThreadException e){
            Log.e("error ", "podczas dzialania");
        }
    }

    private String jsonParser_cryptonator(String str){

        String responseList = "";
        try{
            JSONObject jsonObject = new JSONObject(str);
            JSONObject tickerObject = jsonObject.getJSONObject(TICKER);
            responseList = tickerObject.getString(PRICE);
        } catch (JSONException e) {
            e.printStackTrace();
        }
        return responseList;
    }

    private class GetExchangeData extends AsyncTask<Void, Void, Void>{

        @Override
        protected Void doInBackground(Void... params) {

            Polaczenie polaczenie = new Polaczenie();
            String exchangeData = polaczenie.nawiazPolaczenie(final_url, Polaczenie.GET);
            Log.d("exchange",exchangeData);
            final_crypto_value = jsonParser_cryptonator(exchangeData);
            Log.d("final_crypto_value", final_crypto_value);
            return null;
        }

        @Override
        protected void onPostExecute(Void aVoid) {
            super.onPostExecute(aVoid);

            if(final_crypto_value.isEmpty()){
                Toast.makeText(CalculatorActivity.this, R.string.no_exchange_data_info, Toast.LENGTH_SHORT).show();
                return;
            }

            TextView tv = (TextView)findViewById(R.id.tv_finalURL);
            tv.setText(final_crypto_value);
        }
    }

    public void calculate(View view){

        Float multiplier;
        EditText editText = (EditText)findViewById(R.id.et_quantity);
        try{
            multiplier = Float.parseFloat(editText.getText().toString());
            if(multiplier<0){
                Toast.makeText(CalculatorActivity.this, "Negative number",Toast.LENGTH_SHORT).show();
                return;
            }
        } catch (Exception e){
            Toast.makeText(CalculatorActivity.this, "Wrong value detected", Toast.LENGTH_SHORT).show();
            return;
        }

        Float finalResult = multiplier * Float.parseFloat(final_crypto_value);
        TextView tv = (TextView)findViewById(R.id.tv_finalResult);
        tv.setText(finalResult.toString());

    }

